INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# å‰è¨€\n\nåœ¨å‰ç«¯å‡çº§åˆ°äº†httpsä¹‹å,ä¸ƒç‰›çš„æœåŠ¡httpsæ”¶è´¹,å†³å®šæ¢ä¸€ä¸ªæœåŠ¡æä¾›å•†.ç°åœ¨æŠŠvue+springbootçš„ä¸ƒç‰›æ¥å…¥å†™ä¸‹.\n\n## SpringBoot\n\n1. å¯¼å…¥ä¸ƒç‰›äº‘Mavenä¾èµ–\n\n   ```xml\n   <!--ä¸ƒç‰›äº‘å‚¨å­˜-->\n   <dependency>\n     <groupId>com.qiniu</groupId>\n     <artifactId>qiniu-java-sdk</artifactId>\n     <version>7.9.5</version>\n   </dependency>\n   ```\n\n2. ä¸ƒç‰›äº‘çš„å·¥å…·ç±»,è¿™é‡Œåªæœ‰è·å–tokençš„åŠŸèƒ½\n\n   ```java\n   import com.qiniu.util.Auth;\n   import lombok.NoArgsConstructor;\n   import org.springframework.beans.factory.annotation.Value;\n   import org.springframework.stereotype.Component;\n   \n   /**\n    * @author loveliness\n    * @description ä¸ƒç‰›ä¸Šä¼ å·¥å…·ç±»\n    */\n   @NoArgsConstructor\n   @Component\n   public class QiniuUpload {\n   \n       @Value(\"${qi-niu.access-key}\")\n       private String accessKey;\n       @Value(\"${qi-niu.secret-key}\")\n       private String secretKey;\n       @Value(\"${qi-niu.bucket}\")\n       private String bucketName;\n   \n   \n       /**\n        * å®¢æˆ·ç«¯è·å–ä¸Šä¼ çš„å‡­è¯\n        *\n        * @return ä¸ƒç‰›ä¸Šä¼ å‡­è¯\n        */\n       public String getUpToken() {\n           Auth auth = Auth.create(accessKey, secretKey);\n           return auth.uploadToken(bucketName);\n       }\n   }\n   ```\n\n3. åœ¨é…ç½®æ–‡ä»¶ä¸­å†™å…¥ä¸ƒç‰›çš„å¯†é’¥\n\n   ```yml\n   # é…ç½®ä½ çš„ä¸ƒç‰›äº‘\n   qi-niu:\n     access-key: \n     secret-key: \n     bucket: \n   ```\n\n4. ç›´æ¥åœ¨Controllerä¸­è°ƒç”¨\n\n   ```java\n   /**\n    * @author loveliness\n    */\n   @RestController\n   @RequestMapping(\"/qiniu\")\n   @Api(tags = \"ä¸ƒç‰›\")\n   @AllArgsConstructor\n   public class QiNiuController {\n   \n       private final QiniuUpload qiniuUpload;\n   \n       @GetMapping(\"/getQiNiuToken\")\n       public Result getQiNiuToken() {\n           return Result.ok().data(qiniuUpload.getUpToken());\n       }\n   }\n   ```\n\nè·å–ä¸ƒç‰›tokençš„åå°ç¨‹åºå†™å¥½äº†\n\n## VUE\n\n1. npmå¯¼å…¥ä¾èµ–\n\n   ```sh\n   yarn add qiniu-js\n   //or\n   npm install qiniu-js -S\n   ```\n\n2. è¿™æ˜¯ä¸Šä¼ çš„æ–¹æ³•,è¯·æ ¹æ®è‡ªå·±çš„\n\n   ```javascript\n   this.$refs.cropper.getCropBlob(async (img) => {\n                           let that = this;\n                           let observer = {\n                               next() {\n   \n                               },\n                               error(res) {\n                                   ElNotification.error({\n                                       title: \'ç½‘ç»œé”™è¯¯\' + res,\n                                       message: \'æœåŠ¡å™¨è¶…æ—¶\'\n                                   })\n                               },\n                               complete(data) {\n                                   // this.status = \"success\";\n                                   ElNotification({\n                                       message: \'ä¸Šä¼ æˆåŠŸ\',\n                                       type: \'success\'\n                                   })\n                                   //ä¸Šä¼ æˆåŠŸåè¿”å›çˆ¶ç»„ä»¶\n                                   that.$emit(\'upload-img-success\', data);\n                               }\n                           }\n                           uploadImg(img, observer);\n                       })\n   ```\n\n   ```javascript\n   export async function uploadImg(file, observer) {\n       let token = await getQiNiuToken();\n       token = token.data;\n       let config = {\n           useCdnDomain: true,\n       };\n       let observable = upload(file, null, token, {}, config)\n       observable.subscribe(observer) // ä¸Šä¼ å¼€å§‹\n   }\n   ```\n\n   ```javascript\n   function getQiNiuToken() {\n       return request({\n           url: \'qiniu/getQiNiuToken\',\n           method: \'get\'\n       })\n   }\n   ```\n\n   \n\n', 'ä¸ƒç‰›äº‘OSS');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# ä¼ä¸šä¸€\n\n## Springboot Mybatis\n\n### MAVENé…ç½®æ–‡ä»¶\n\nmavençš„é…ç½®æ–‡ä»¶settings.xmlå­˜åœ¨äºä¸¤ä¸ªåœ°æ–¹ï¼š\n\n- å®‰è£…çš„åœ°æ–¹ï¼š`${M2_HOME}/conf/settings.xml`\n- ç”¨æˆ·çš„ç›®å½•ï¼š`${user.home}/.m2/settings.xml`\n\n#### setting.xml\n\n```xml\n<settings xmlns=\"http://maven.apache.org/SETTINGS/1.0.0\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:schemaLocation=\"http://maven.apache.org/SETTINGS/1.0.0 http://maven.apache.org/xsd/settings-1.0.0.xsd\">\n<mirrors>\n    <mirror>\n      <id>nexus-aliyun</id>\n      <mirrorOf>central</mirrorOf>\n      <name>Nexus aliyun</name>\n      <url>http://maven.aliyun.com/nexus/content/groups/public</url>\n    </mirror>\n	 </mirrors>\n    <servers>\n    	<server>\n      <id>deploymentRepo</id>\n     	 <username>repouser</username>\n      	<password>repopwd</password>\n   		</server>\n  </servers>\n</settings>\n```\n\n#### pom.xml\n\n```xml\n<project\n    xmlns=\"http://maven.apache.org/POM/4.0.0\"\n    xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n    xsi:schemaLocation=\"http://maven.apache.org/POM/4.0.0 http://maven.apache.org/xsd/maven-4.0.0.xsd\">\n    \n    <groupId>com.winner.trade</groupId>\n    <artifactId>trade-core</artifactId>\n    <version>1.0.0-SNAPSHOT</version>\n    \n    <!-- æ‰“åŒ…çš„æœºåˆ¶ï¼Œå¦‚pom, jar, maven-plugin, ejb, war, ear, rar, parï¼Œé»˜è®¤ä¸ºjar -->\n    <packaging>jar</packaging>\n    \n    \n    <!-- å®šä¹‰æœ¬é¡¹ç›®çš„ä¾èµ–å…³ç³» -->\n    <dependencies>\n        \n        <!-- æ¯ä¸ªdependencyéƒ½å¯¹åº”è¿™ä¸€ä¸ªjaråŒ… -->\n        <dependency>\n            \n            <!-- ä¸€èˆ¬æƒ…å†µä¸‹ï¼Œmavenæ˜¯é€šè¿‡groupIdã€artifactIdã€versionè¿™ä¸‰ä¸ªå…ƒç´ å€¼ï¼ˆä¿—ç§°åæ ‡ï¼‰æ¥æ£€ç´¢è¯¥æ„ä»¶ -->\n            <groupId>com.winner.trade</groupId>\n            <artifactId>trade-test</artifactId>\n            <version>1.0.0-SNAPSHOT</version>\n            <!-- mavenè®¤ä¸ºï¼Œç¨‹åºå¯¹å¤–éƒ¨çš„ä¾èµ–ä¼šéšç€ç¨‹åºçš„æ‰€å¤„é˜¶æ®µå’Œåº”ç”¨åœºæ™¯è€Œå˜åŒ–ï¼Œæ‰€ä»¥mavenä¸­çš„ä¾èµ–å…³ç³»æœ‰ä½œç”¨åŸŸ(scope)çš„é™åˆ¶ã€‚\n                scopeåŒ…å«å¦‚ä¸‹çš„å–å€¼ï¼šcompileï¼ˆç¼–è¯‘èŒƒå›´ï¼‰ã€providedï¼ˆå·²æä¾›èŒƒå›´ï¼‰ã€runtimeï¼ˆè¿è¡Œæ—¶èŒƒå›´ï¼‰ã€testï¼ˆæµ‹è¯•èŒƒå›´ï¼‰ã€systemï¼ˆç³»ç»ŸèŒƒå›´ï¼‰ -->\n            <scope>test</scope>\n            <!-- è®¾ç½®æŒ‡ä¾èµ–æ˜¯å¦å¯é€‰ï¼Œé»˜è®¤ä¸ºfalse,å³å­é¡¹ç›®é»˜è®¤éƒ½ç»§æ‰¿:ä¸ºtrue,åˆ™å­é¡¹ç›®å¿…éœ€æ˜¾ç¤ºçš„å¼•å…¥ï¼Œä¸dependencyManagementé‡Œå®šä¹‰çš„ä¾èµ–ç±»ä¼¼ ã€‚ -->\n            <optional>false</optional>\n            <!-- å±è”½ä¾èµ–å…³ç³»ã€‚\n                æ¯”å¦‚é¡¹ç›®ä¸­ä½¿ç”¨çš„libAä¾èµ–æŸä¸ªåº“çš„1.0ç‰ˆï¼ŒlibBä¾èµ–æŸä¸ªåº“çš„2.0ç‰ˆï¼Œç°åœ¨æƒ³ç»Ÿä¸€ä½¿ç”¨2.0ç‰ˆï¼Œå°±åº”è¯¥å±è”½æ‰å¯¹1.0ç‰ˆçš„ä¾èµ– -->\n            <exclusions>\n                <exclusion>\n                    <groupId>org.slf4j</groupId>\n                    <artifactId>slf4j-api</artifactId>\n                </exclusion>\n            </exclusions>\n        </dependency>\n    </dependencies>\n    \n    <!-- ä¸ºpomå®šä¹‰ä¸€äº›å¸¸é‡ï¼Œåœ¨pomä¸­çš„å…¶å®ƒåœ°æ–¹å¯ä»¥ç›´æ¥å¼•ç”¨\n        ä½¿ç”¨æ–¹å¼ å¦‚ä¸‹ ï¼š${file.encoding} -->\n    <properties>\n        <file.encoding>UTF-8</file.encoding>\n        <java.source.version>1.5</java.source.version>\n        <java.target.version>1.5</java.target.version>\n    </properties>\n</project>\n```\n\n### Yaml properties \n\nymlæœ€å¤§çš„å¥½å¤„åœ¨äºå…¶æ‹¥æœ‰å¤©ç„¶çš„æ ‘çŠ¶ç»“æ„ï¼Œæ‰€ä»¥ç€æ‰‹å°è¯•å°†propertiesæ–‡ä»¶æ›´æ”¹ä¸ºymlæ–‡ä»¶ï¼Œå‘ç°äº†å‡ ä¸ªè¦æ³¨æ„çš„åœ°æ–¹ï¼š \n\n1. åœ¨propertiesæ–‡ä»¶ä¸­æ˜¯ä»¥â€.â€è¿›è¡Œåˆ†å‰²çš„ï¼Œ åœ¨ymlä¸­æ˜¯ç”¨â€:â€è¿›è¡Œåˆ†å‰²; \n2. ymlçš„æ•°æ®æ ¼å¼å’Œjsonçš„æ ¼å¼å¾ˆåƒï¼Œéƒ½æ˜¯K-Væ ¼å¼ï¼Œå¹¶ä¸”é€šè¿‡â€:â€è¿›è¡Œèµ‹å€¼ï¼› \n3. åœ¨ymlä¸­ç¼©è¿›ä¸€å®šä¸èƒ½ä½¿ç”¨TABå¦åˆ™ä¼šæŠ¥å¾ˆå¥‡æ€ªçš„é”™è¯¯ï¼›ç¼©è¿›åªèƒ½ç”¨ç©ºæ ¼ï¼ï¼ï¼ï¼\n4. æ¯ä¸ªkeyçš„å†’å·åé¢ä¸€å®šéƒ½è¦åŠ ä¸€ä¸ªç©ºæ ¼ï¼›\n5. å¦‚æœä½ çš„é¡¹ç›®ä¸­å­˜åœ¨ application.properties æ–‡ä»¶ï¼Œ application.yml æ–‡ä»¶å°±åªæ˜¯ä¸€ä¸ªæ‘†è®¾ã€‚\n\n### Mapperæ˜ å°„å™¨\n\nxml æ•°æ®åº“