INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('è¦æ±‚å†™å‡ºä¸€ä¸ªä¸‹å›¾çš„æ ·å¼\n![é¡µé¢æ•ˆæœå›¾](https://tecs-prod-static.obs.cn-north-1.myhuaweicloud.com/richtext%2Fimage%2F20220413%2F32a718a62497473e8e669e7401cbad16.png)\n\næˆ‘ä¹Ÿä¸æ˜¯ä¸“ä¸šå†™å‰ç«¯çš„,éšä¾¿å†™å†™å°±å®Œäº‹äº†\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Document</title>\n    <link rel=\"stylesheet\" href=\"https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css\"\n        integrity=\"sha512-SfTiTlX6kk+qitfevl/7LibUOeJWlt9rbyDn92a1DqWOw9vWG2MFoays0sgObmWazO5BQPiFucnnEAjpAB+/Sw==\"\n        crossorigin=\"anonymous\" referrerpolicy=\"no-referrer\" />\n</head>\n\n<body>\n    <div class=\"main\">\n        <div class=\"img_in\">\n            <span class=\"left icon\"><i class=\"fa fa-chevron-left fa-3x\"></i></span>\n            <span class=\"right icon\"><i class=\"fa fa-chevron-right fa-3x\"></i></span>\n            <span class=\"buttom\">\n                <i class=\"fa fa-circle fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n                <i class=\"fa fa-circle-o fa-1x\"></i>\n            </span>\n        </div>\n    </div>\n</body>\n\n\n\n<style>\n    body {\n        margin: 0;\n    }\n\n    .main {\n        margin: 0 auto;\n        width: 800px;\n        height: 400px;\n        border: 3px solid;\n    }\n\n    .img_in {\n        width: 100%;\n        height: 100%;\n        background-image: url(\'https://s2.loli.net/2022/04/03/NxQafWFpP5YkTm3.jpg\');\n        background-size: cover;\n        text-align: center;\n    }\n\n    .left {\n        float: left;\n    }\n\n    .right {\n        float: right;\n    }\n\n    .icon {\n     