INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# ä½¿ç”¨Vue3å®Œæˆç½‘ç»œæ•°æ®çš„è·å–åŠæ¸²æŸ“\n\nåŸºäºVue3çš„Composition APIå†™çš„ä¸€ä¸ªå®éªŒ\nå¸¦æœ‰åˆ é™¤åŠŸèƒ½ä½†æ˜¯æ¥å£æ²¡æœ‰çœŸæ­£çš„è¯·æ±‚,å®ç°äº†å±€éƒ¨åˆ·æ–°\n\nV2:å®ç°äº†å¢åŠ å’Œä¿®æ”¹,ä½†æ˜¯æ¥å£éƒ½æ˜¯æ­»çš„,å®ç°çš„å±€éƒ¨åˆ·æ–°\n\nV1:![image-20220427120751137](https://s2.loli.net/2022/04/27/lUkiF6bgDJNGTAL.png)\n\nV2:![image-20220428184050542](https://s2.loli.net/2022/04/28/mglqPp3rBheKvTU.png)\n\n![image-20220428184117317](https://s2.loli.net/2022/04/28/UuCq6mBXyYDdKNf.png)\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!-- å¯¼å…¥æ ·å¼ -->\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/element-plus/dist/index.css\" />\n    <!-- å¯¼å…¥ Vue 3 -->\n    <script src=\"https://unpkg.com/vue@next\"></script>\n    <!-- å¯¼å…¥ç»„ä»¶åº“ -->\n    <script src=\"https://unpkg.com/element-plus\"></script>\n    <!-- axios -->\n    <script src=\"https://unpkg.com/axios/dist/axios.min.js\"></script>\n    <title>Document</title>\n</head>\n\n<body>\n    <div class=\"wrap\" id=\"app\">\n        <table>\n            <thead>\n                <tr>\n                    <th>id</th>\n                    <th>æè¿°</th>\n                    <th>æ ‡é¢˜</th>\n                    <th>å›¾ç‰‡</th>\n                    <th>æ“ä½œ</th>\n                </tr>\n            </thead>\n            <tbody id=\"j_tb\">\n                <tr>\n                    <td><input v-model=\"blogAdd.articleId\"></td>\n                    <td><input v-model=\"blogAdd.articleShort\"></td>\n                    <td><input v-model=\"blogAdd.articleTitle\"></td>\n                    <td><input v-model=\"blogAdd.imgUrl\"></td>\n                    <td>\n                        <el-button @click=\"addIt()\">æ·»åŠ </el-button>\n                    </td>\n                </tr>\n                <tr v-for=\"(item,index) in data\">\n                    <td>{{item.articleId}}</td>\n                    <td>{{item.articleShort}}</td>\n                    <td>{{item.articleTitle}}</td>\n                    <td>\n                        <img height=\"160\" :src=\"item.imgUrl\" />\n                    </td>\n                    <td>\n                        <el-button @click=\"deletIt(item.articleId,index)\">åˆ é™¤</el-button>\n                        <br />\n                        <el-button @click=\"editItShow(index)\">ä¿®æ”¹</el-button>\n                    </td>\n                </tr>\n            </tbody>\n        </table>\n        <el-dialog v-model=\"editVisible\" title=\"ä¿®æ”¹\" width=\"30%\">\n            <input v-model=\"blogEdit.articleId\">\n            <input v-model=\"blogEdit.articleShort\">\n            <input v-model=\"blogEdit.articleTitle\">\n            <input v-model=\"blogEdit.imgUrl\">\n    \n            <template #footer>\n                <span class=\"dialog-footer\">\n                    <el-button @click=\"editVisible = false\">Cancel</el-button>\n                    <el-button type=\"primary\" @click=\"editIt()\">Confirm</el-button>\n                </span>\n            </template>\n        </el-dialog>\n    </div>\n\n</body>\n<script>\n\n    const request = axios.create({\n        baseURL: \'https://javaee.xyz/\',\n        timeout: 10000\n    })\n\n    const VueApp = {\n        setup() {\n            let current = Vue.ref(1);\n            let size = Vue.ref(5);\n\n            let data = Vue.ref([]);\n            Vue.onBeforeMount(async () => {\n                let res = await request({\n                    url: \'article/getList\',\n                    method: \'GET\',\n                    params: {\n                        current: current.value,\n                        size: size.value,\n                    }\n                })\n                data.value = res.data.data.records;\n            });\n\n            let deletIt = async (id, index) => {\n                console.log(index)\n\n                // ä¸å¯è¯·æ±‚æ¥å£,åªåšæµ‹è¯•\n                let res = await request({\n                    url: \'demo/deleteIt\',\n                    method: \'GET\',\n                    params: {\n                        id\n                    }\n                })\n                //åšåˆ¤æ–­æ¡ä»¶\n                data.value.splice(index, 1);\n            }\n\n            let blogEdit = Vue.ref([]);\n            let editVisible = Vue.ref(false);\n            let editItShow = async (index) => {\n                editVisible.value = true;\n                blogEdit.value = data.value[index];\n                blogEdit.value.index = index;\n            }\n            async function editIt(index) {\n                editVisible.value = false;\n                await addOrUpdate(blogEdit.value);\n\n                // åŠ¨æ€ä¿®æ”¹\n                data.value[blogEdit.value.index] = blogEdit.value;\n            }\n\n            let blogAdd = Vue.ref({});\n            async function addIt() {\n                await addOrUpdate(blogAdd.value);\n                // åŠ¨æ€æ·»åŠ \n                data.value.push(blogAdd.value);\n            }\n\n            let addOrUpdate = async (blogVO) => {\n                // ä¸å¯è¯·æ±‚æ¥å£,åªåšæµ‹è¯•\n                return await request({\n                    url: \'demo/addOrUpdate\',\n                    method: \'POST\',\n                    data: blogVO\n                })\n            }\n\n            return {\n                data, deletIt, addIt, editIt, blogAdd, blogEdit, editItShow, editVisible\n            }\n        }\n    }\n\n    const app = Vue.createApp(VueApp)\n    app.use(ElementPlus);\n    app.mount(\'#app\'); \n</script>\n\n<style>\n    * {\n        padding: 0;\n        margin: 0;\n    }\n\n    .wrap {\n        width: 100%;\n        margin: 0 auto;\n    }\n\n    table {\n        border-collapse: collapse;\n        border-spacing: 0;\n        border: 1px solid #c0c0c0;\n        width: 80%;\n        margin: 0 auto;\n    }\n\n    th,\n    td {\n        border: 1px solid #d0d0d0;\n        color: #404060;\n        padding: 10px;\n        font: 14px \"å¾®è½¯é›…é»‘\";\n        text-align: center;\n    }\n\n    th {\n        background-color: #09c;\n        font: bold 16px \"å¾®è½¯é›…é»‘\";\n        color: #fff;\n    }\n\n\n    tbody tr {\n        background-color: #f0f0f0;\n    }\n\n    tbody tr:hover {\n        cursor: pointer;\n        background-color: #fafafa;\n    }\n\n    tbody tr td span {\n        text-decoration: none;\n    }\n\n    tbody tr td span:hover {\n        color: red;\n    }\n</style>\n\n</html>\n```', 'è€å»‰è®²VUE_day1');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# åˆ©ç”¨Vueä¾¦å¬å™¨ å®Œæˆç”¨æˆ·åå·²å­˜åœ¨æ¡ˆä¾‹\n\n![image-20220506154503164](https://s2.loli.net/2022/05/06/zi6x83jNsGf5vBb.png)\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!-- å¯¼å…¥æ ·å¼ -->\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/element-plus/dist/index.css\" />\n    <!-- å¯¼å…¥ Vue 3 -->\n    <script src=\"https://unpkg.com/vue@next\"></script>\n    <!-- å¯¼å…¥ç»„ä»¶åº“ -->\n    <script src=\"https://unpkg.com/element-plus\"></script>\n    <!-- axios -->\n    <script src=\"https://unpkg.com/axios/dist/axios.min.js\"></script>\n    <title>Document</title>\n</head>\n\n<body>\n    <div id=\"app\">\n        <span style=\"color: red;\">{{tipMsg}}</span>\n        <el-input v-model=\"userName\" placeholder=\"è¯·è¾“å…¥ç”¨æˆ·å\" />\n    </div>\n\n</body>\n<script>\n    // import { watch } from \"@vue/runtime-core\";\n\n    const request = axios.create({\n        baseURL: \'http://javaee.xyz/\',\n        timeout: 10000\n    })\n\n    const VueApp = {\n        setup() {\n            let userName = Vue.ref(\"\");\n            let tipMsg = Vue.ref(\"\");\n            Vue.watch(userName, async (newvalue, oldvalue) => {\n                // è¯·æ±‚åç«¯\n                // let res = await request({\n                //     url: \'/isHaveUser\',\n                //     method: \'GET\',\n                //     params: {\n                //         userName: newvalue\n                //     }\n                // })\n                let res = {\n                    \"success\": true,\n                    \"code\": 200,\n                    \"message\": null,\n                    \"data\": true\n                };\n                if (res.data) {\n                    tipMsg.value = \"å­˜åœ¨è¯¥ç”¨æˆ·\"\n                } else {\n                    tipMsg.value = \"\"\n                }\n                console.dir(res)\n                console.log(tipMsg.value)\n            });\n\n\n            return {\n                userName, tipMsg\n            }\n        }\n    }\n\n    const app = Vue.createApp(VueApp)\n    app.use(ElementPlus);\n    app.mount(\'#app\'); \n</script>\n\n<style>\n\n</style>\n\n</html>\n```\n\n\n\n\n\n# Vueè®¡ç®—å±æ€§\n\néœ€æ±‚:\n\n- éœ€æ±‚1: æ±‚2ä¸ªæ•°çš„å’Œæ˜¾ç¤ºåˆ°é¡µé¢ä¸Š\n- éœ€æ±‚2: å­—ç¬¦ä¸²ç¿»è½¬\n\n![image-20220506154534727](https://s2.loli.net/2022/05/06/U25hoYmC4vcqbJM.png)\n\n```html\n<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta charset=\"UTF-8\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <!-- å¯¼å…¥æ ·å¼ -->\n    <link rel=\"stylesheet\" href=\"https://unpkg.com/element-plus/dist/index.css\" />\n    <!-- å¯¼å…¥ Vue 3 -->\n    <script src=\"https://unpkg.com/vue@next\"></script>\n    <!-- å¯¼å…¥ç»„ä»¶åº“ -->\n    <script src=\"https://unpkg.com/element-plus\"></script>\n    <!-- axios -->\n    <script src=\"https://unpkg.com/axios/dist/axios.min.js\"></script>\n    <title>Document</title>\n</head>\n\n<body>\n    <div id=\"app\">\n        <p>å’Œä¸º: {{ num }}</p>\n        <p>{{ reverseMessage }}</p>\n    </div>\n\n</body>\n<script>\n    // import { watch } from \"@vue/runtime-core\";\n\n    const request = axios.create({\n        baseURL: \'http://javaee.xyz/\',\n        timeout: 10000\n    })\n\n    const VueApp = {\n        setup() {\n            let a = Vue.ref(10);\n            let b = Vue.ref(20);\n            let message = Vue.ref(\"æˆ‘æ˜¯ä¸ªå­—ç¬¦ä¸²\");\n            let num = Vue.computed({\n                get: () => {\n                    //æµè§ˆå™¨å¾—åˆ°å€¼æ—¶è§¦å‘,ä¸èƒ½æ‹¿åˆ°å€¼\n                    return a.value + b.value;\n                },\n                set: (res) => {\n                    //è®¾ç½®å€¼æ—¶è§¦å‘\n                    console.log(res)\n                }\n            });\n            let reverseMessage = Vue.computed({\n                get: () => {\n                    //æµè§ˆå™¨å¾—åˆ°å€¼æ—¶è§¦å‘,ä¸èƒ½æ‹¿åˆ°å€¼\n                    return message.value.split(\"\").reverse().join(\"\");\n                },\n                set: (res) => {\n                    //è®¾ç½®å€¼æ—¶è§¦å‘\n                    console.log(res)\n                }\n            });\n\n\n            return {\n                num, reverseMessage\n            }\n        }\n    }\n\n    const app = Vue.createApp(VueApp)\n    app.use(ElementPlus);\n    app.mount(\'#app\'); \n</script>\n\n<style>\n\n</style>\n\n</html>\n```\n\n', 'è€å»‰è®²VUE_day2');
