INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('# VUE_ROUTER ç®€å•åº”ç”¨\n\nè¿™æ¬¡è¿˜æ˜¯ä½¿ç”¨äº†å¤§å®¶ç†ŸçŸ¥çš„\"element-plus\": \"^2.2.4\"\n\né™¤æ­¤ä¹‹å¤–æ·»åŠ äº†\"vue-router\": \"^4.0.15\"\n\nç›´æ¥ä½¿ç”¨äº†elementçš„menuçš„routeræ¨¡å¼,çœäº†ä¸å°‘éº»çƒ¦\n\n- page1ç”¨æ¥åˆ é™¤å’Œæ·»åŠ token\n\n  ![image-20220607174047269](https://s2.loli.net/2022/06/07/tcOjr63YIHxbMSk.png)\n\n- page2ç”¨æ¥ä¸éœ€è¦tokenè®¿é—®\n\n  ![image-20220607174122998](https://s2.loli.net/2022/06/07/9eAtdphjMU5QVDk.png)\n\n- page3æ˜¯éœ€è¦tokenæ‰å¯ä»¥è¿›å…¥çš„é¡µé¢\n\n  ![image-20220607174152405](https://s2.loli.net/2022/06/07/TqEcDuIAg1mty63.png)\n\n  å¦‚æœtokenä¸ºnullé‚£ä¹ˆè¿›å…¥ç¬¬ä¸‰é¡µé¢å°±ä¼šæç¤ºç”¨æˆ·æœªç™»é™†\n\n  â€‹	![image-20220607174240960](https://s2.loli.net/2022/06/07/vWPN7zOfohgrTe9.png)\n\nrouter/index.js\n\n```js\nimport {createRouter, createWebHashHistory} from \"vue-router\";\nimport {ElNotification} from \'element-plus\'\n\nconst routes = [\n    {path: \'/\', redirect: \'/page1\'},\n    {path: \'/page1\', component: () => import(\'../components/page1.vue\'),},\n    {path: \'/page2\', component: () => import(\'../components/page2.vue\'),},\n    {\n        path: \'/page3\', component: () => import(\'../components/page3.vue\'),\n        beforeEnter: () => {\n            if (localStorage.getItem(\"token\") === null) {\n                ElNotification({\n                    message: \'ç”¨æˆ·æœªç™»é™†\',\n                    type: \'error\'\n                })\n                return {path: \'/\'}\n            }\n        },\n    },\n]\n\nconst router = createRouter({\n    history: createWebHashHistory(),\n    routes,\n})\n\n// å¯¼èˆªè½¬æˆè·¯ç”±\nexport default router\n\n```\n\nApp.vue\n\n```vue\n<script setup>\n    // This starter template is using Vue 3 <script setup> SFCs\n    // Check out https://vuejs.org/api/sfc-script-setup.html#script-setup</script>\n\n<template>\n    <el-menu\n            style=\"float: left;\"\n            router\n            default-active=\"1\"\n            class=\"el-menu-vertical-demo\"\n    >\n        <el-menu-item index=\"1\" route=\"/page1\">\n            <el-icon>\n                <icon-menu/>\n            </el-icon>\n            <span>è·³è½¬1</span>\n        </el-menu-item>\n        <el-menu-item index=\"2\" route=\"/page2\">\n            <el-icon>\n                <document/>\n            </el-icon>\n            <span>è·³è½¬2</span>\n        </el-menu-item>\n        <el-menu-item index=\"3\" route=\"/page3\">\n            <el-icon>\n                <setting/>\n            </el-icon>\n            <span>è·³è½¬3</span>\n        </el-menu-item>\n    </el-menu>\n    <router-view style=\"float: right;\"/>\n</template>\n\n<style>\n    #app {\n        height: 100%;\n    }\n</style>\n```\n\nMain.js\n\n```js\nimport {createApp} from \'vue\'\nimport App from \'./App.vue\'\nimport ElementPlus from \'element-plus\'\nimport \'element-plus/dist/index.css\'\nimport * as ElIconModules from \'@element-plus/icons-vue\'\nimport router from \'./router\'\n\nlet app = createApp(App)\n\napp.use(router)\napp.use(ElementPlus)\n// ç»Ÿä¸€æ³¨å†Œel-iconå›¾æ ‡\nfor (let iconName in ElIconModules) {\n    app.component(iconName, ElIconModules[iconName])\n}\napp.mount(\'#app\')\n\n```\n\nPage1.vue\n\n```vue\n<template>\n    <h1>page1</h1>\n    <el-button @click=\"generateToken()\" plain size=\"mini\" type=\"danger\">ç”Ÿæˆtoken</el-button>\n    <el-button @click=\"removeToken()\" plain size=\"mini\" type=\"danger\">åˆ é™¤token</el-button>\n</template>\n\n<script>\n    export default {\n        name: \"page1\",\n    }\n</script>\n\n<script setup>\n    let generateToken = function () {\n        console.log(\"jsakdhfgsakdjh\")\n        localStorage.setItem(\'token\', \'haha\');\n    }\n    let removeToken = function () {\n        localStorage.removeItem(\'token\');\n    }\n\n</script>\n\n<style scoped>\n\n</style>\n\n```\n\nè¿™ä¸ªçœŸæ²¡å¿…è¦å¼€æºäº†,ok', 'è€å»‰è®²VUE_day7');
INSERT INTO `tactic_detail` (`content`, `tactic_id`) VALUES ('æ ¹æ®å¦‚å›¾æ‰€ç¤ºç¨‹åºæµç¨‹å›¾ï¼Œåˆ†åˆ«ç”¨æœ€å°‘çš„æµ‹è¯•ç”¨ä¾‹å®ŒæˆåŸºæœ¬è·¯å¾„è¦†ç›–ã€æ¡ä»¶/åˆ¤å®šè¦†ç›–çš„æµ‹è¯•è®¾è®¡\n\n![image-20220330163059592](https://s2.loli.net/2022/04/08/VlzjOhAK2Ytgdo6.png)\n\n\n## å­˜åœ¨çš„ç»„åˆç¤ºä¾‹\n\n| ç»„åˆç¼–å· | 1(x > 0)<br/>3(x < -10) | 2(y > 10)<br/>4(y < 0) | åˆ¤å®šæ¡ä»¶å–å€¼ | åˆ¤å®š/æ¡ä»¶ç»„åˆ         |\n| -------- | ----------------------- | ---------------------- | ------------ | --------------------- |\n| 1        | T1                      | T2                     | M=T          | x > 0,y > 10,Må–çœŸ    |\n| 2        | T1                      | F2                     | M=F          | x > 0,y <= 10,Må–å‡   |\n| 3        | F1                      | T2                     | M=F          | x <= 0,y > 10,Må–å‡   |\n| 4        | F1                      | F2                     | M=F          | x <= 0,y <= 10,Må–å‡  |\n| 5        | T3                      | T4                     | N=T          | x < -10,y < 0,Nå–çœŸ   |\n| 6        | T3                      | F4                     | N=T          | x < -10,y >= 0,Nå–çœŸ  |\n| 7        | F3                      | T4                     | N=T          | x >= -10,y < 0,Nå–çœŸ  |\n| 8        | F3                      | F4                     | N=F          | x >= -10,y >= 0,Nå–å‡ |\n\n\n\n\n## æ¡ä»¶/åˆ¤å®šè¦†ç›–\n\nè®©æ‰€æœ‰çš„åˆ¤å®šç»“æœè‡³å°‘å‡ºç°ä¸€æ¬¡,å³è¦†ç›–ç»„åˆå­˜åœ¨1-8æ‰€æœ‰\n\n```javascript\nif(x > 0 && y > 10){//M\n  y=y/x;//1\n}//2\nif(x < -10 || y < 0){//N\n  y=-(y + x)//3\n}//4\n```\n\n\n### æµ‹è¯•ç”¨ä¾‹\n\n| æµ‹è¯•ç”¨ä¾‹                             | è¦†ç›–æ¡ä»¶    | è¦†ç›–è·¯å¾„ | è¦†ç›–ç»„åˆ |\n| ------------------------------------ | ----------- | -------- | -------- |\n| è¾“å…¥:x=1,y=11<br/>è¾“å‡º:x=1,y=11      | T1,T2,F3,F4 | 1-4      | 1,8      |\n| è¾“å…¥:x=1,y=-1<br/>è¾“å‡º:x=1,y=0       | T1,F2,F3,T4 | 2-3      | 2,7      |\n| è¾“å…¥:x=-11,y=11<br/>è¾“å‡º:x=-11,y=0   | F1,T2,T3,F4 | 2-3      | 3